import { useEffect, useState } from 'react';
import axios from 'axios';

function TodoPage() {
  const [user, setUser] = useState(null);
  const [todos, setTodos] = useState([]);
  const [text, setText] = useState('');
  const [editId, setEditId] = useState(null);
  const [editText, setEditText] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/auth/user', { withCredentials: true })
      .then(res => setUser(res.data))
      .catch(() => window.location.href = '/');

    axios.get('http://localhost:5000/api/todos', { withCredentials: true })
      .then(res => setTodos(res.data));
  }, []);

  const addTodo = async () => {
    if (!text.trim()) return;
    const res = await axios.post('http://localhost:5000/api/todos', { text }, { withCredentials: true });
    setTodos([...todos, res.data]);
    setText('');
  };

  const startEdit = (todo) => {
    setEditId(todo._id);
    setEditText(todo.text);
  };

  const cancelEdit = () => {
    setEditId(null);
    setEditText('');
  };

  const saveEdit = async (id) => {
    if (!editText.trim()) return;
    const res = await axios.put(`http://localhost:5000/api/todos/${id}`, 
      { text: editText }, { withCredentials: true });
    setTodos(todos.map(t => (t._id === id ? res.data : t)));
    setEditId(null);
    setEditText('');
  };

  const toggleCompleted = async (todo) => {
    const res = await axios.put(`http://localhost:5000/api/todos/${todo._id}`, 
      { completed: !todo.completed }, { withCredentials: true });
    setTodos(todos.map(t => (t._id === todo._id ? res.data : t)));
  };

  const deleteTodo = async (id) => {
    await axios.delete(`http://localhost:5000/api/todos/${id}`, { withCredentials: true });
    setTodos(todos.filter(t => t._id !== id));
  };

  const logout = () => {
    axios.get('http://localhost:5000/auth/logout', { withCredentials: true })
      .then(() => window.location.href = '/');
  };

  if (!user) return <p>Loading...</p>;

  return (
    <div style={{ maxWidth: 600, margin: 'auto' }}>
      <h2>Welcome, {user.name}</h2>
      <button onClick={logout}>Logout</button>

      <div style={{ marginTop: 20 }}>
        <input
          type="text"
          value={text}
          onChange={e => setText(e.target.value)}
          placeholder="Add a new todo"
        />
        <button onClick={addTodo}>Add</button>
      </div>

      <ul style={{ listStyle: 'none', paddingLeft: 0 }}>
        {todos.map(todo => (
          <li key={todo._id} style={{ margin: '10px 0', display: 'flex', alignItems: 'center' }}>
            <input 
              type="checkbox" 
              checked={todo.completed} 
              onChange={() => toggleCompleted(todo)} 
            />
            {editId === todo._id ? (
              <>
                <input
                  type="text"
                  value={editText}
                  onChange={e => setEditText(e.target.value)}
                  style={{ flexGrow: 1, marginLeft: 8 }}
                />
                <button onClick={() => saveEdit(todo._id)}>Save</button>
                <button onClick={cancelEdit}>Cancel</button>
              </>
            ) : (
              <>
                <span 
                  style={{
                    flexGrow: 1,
                    marginLeft: 8,
                    textDecoration: todo.completed ? 'line-through' : 'none',
                    cursor: 'pointer'
                  }}
                  onDoubleClick={() => startEdit(todo)}
                >
                  {todo.text}
                </span>
                <button onClick={() => startEdit(todo)}>Edit</button>
                <button onClick={() => deleteTodo(todo._id)}>Delete</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default TodoPage;
